import React, { useState } from 'react';
import MenuElement from './MenuElement.js';

import './LeftMenu.css';

const LeftMenu = () => {

  let elementList = [];
  for (let i = 0 ; i < 50 ; i ++) {
    const Text = "Element " + i;

    elementList.push(<MenuElement val={Text} src="placeholder.jpg" key={"e" + i} onClick={console.log("Test Click!")}/>)
  }

  const [elements, setElements] = useState(<MenuElement val="Empty Element" src="placeholder.jpg" key="empty" onClick={() => console.log("x")}/>);


  return (
    <div className="menu left">
      <div className="banner">
        Menu
      </div>
      <div className="elements">
        {elements}
      </div>
    </div>
  )
}

export default LeftMenu;
